$(document).ready(function(){
	var canvasSlideSpeed = 300;
	var canvasWidth = 240;

	$('#toggle-offcanvas').click(function() {
		if($('body').hasClass('offcanvas')) {
			$('#page').animate({'left': '0px'}, canvasSlideSpeed, function() {
				$('body').removeClass('offcanvas');
				$('html').css('overflow-x','visible');
			});
		} else {
			$('html').css('overflow-x','hidden');
			$('body').addClass('offcanvas');
			$('#page').animate({'left': canvasWidth+'px'}, canvasSlideSpeed);
		}
	});

	$('#offcanvas').height(document.body.clientHeight);

	$(window).resize(function(){
		$('#offcanvas').height(document.body.clientHeight);
		if ($(window).width() > 1183){
			$('#page').animate({'left': '0px'}, canvasSlideSpeed, function () {
				$('body').removeClass('offcanvas');
				$('html').css('overflow-x', 'visible');
			});
		}
	});

	$('.canvas-dropdown a span.fa').click(function(event){
		event.preventDefault();
		if($(this).parent().parent().hasClass('open')) {
			$(this).parent().parent().removeClass('open');
		} else {
			$(this).parent().parent().siblings().removeClass('open');
			$(this).parent().parent().addClass('open');
		}
	});


	// Scroll to top
	$('.top-link a').click(function(e){
		e.preventDefault();

		if (navigator.userAgent.match(/(iPod|iPhone|iPad|Android|Chrome|Safari)/)) {
			$('body, html').css('height','auto');
		}

		$("html, body").animate({scrollTop: '0'},{"queue": false});

		if (navigator.userAgent.match(/(iPod|iPhone|iPad|Android|Chrome|Safari)/)) {
			$('body, html').css('height','100%');
		}
		return false;
	});


	// Responsive Tables
	$('#content table').addClass('table');
	$('#content table').wrap('<div class="table-responsive"></div>');

	// Tabs
	$('.tabbable').tabs();

	/* Flexslider */
	$('.flexslider').flexslider({
		animation: "slide",
		slideDirection: "horizontal",
		slideshow: true,
		slideshowSpeed: 5000,
		animationDuration: 600,
		controlNav: true,
		directionNav: false,
		keyboardNav: true,
		mousewheel: false,
		prevText: "Zurück",
		nextText: "Weiter",
		pausePlay: false,
		pauseText: "Pause",
		playText: "Abspielen",
		randomize: false,
		animationLoop: true,
		pauseOnHover: false
	});

	/* Fancybox */
	$(".fancybox").fancybox({
		'openEffect': 'fade',
		'closeEffect': 'fade',
		'nextEffect': 'fade',
		'prevEffect': 'fade',
		'padding': 1
	});

	// Prevent bootstrap accordion to jump to anchors
	$('.panel-group .accordion-toggle').on('click', function(e) {
		history.pushState( null, null, $(this).attr('href') );
	});


	$('.tx-contact form select').on('change', function(){
		this.form.submit();
	});

	$('.calendar .hasevents').click(function(){
		var ul = $(this).children('.day').children('ul');
		$('.calendar-tooltip .inner').html(ul.clone());
	});

	$('button.show-calendar').click(function(){
		$('.event-calendar').addClass('active');
		$('.event-list').removeClass('active');
	});
	$('button.show-list').click(function(){
		$('.event-calendar').removeClass('active');
		$('.event-list').addClass('active');
	});

	$(".news-year").on("click", function() {
		$(this).parent().toggleClass('news-year-opened');
		$(this).next("ul").toggleClass('hidden');
	})



});



			$(document).ready(function(){
				$('.panel-collapse').on('shown.bs.collapse', function () {
				var activepanel = $(this).attr( "id" );
				//window.location.hash=activepanel;
				});

				if(window.location.hash){
					$(window.location.hash).addClass('in').attr("aria-expanded","true");
					$(window.location.hash).prev().children('h3').children('a').attr("aria-expanded","true").removeClass('collapsed');
					var offset1 = $(window.location.hash).parent().offset();
					$("html, body").animate({scrollTop: offset1.top},{"queue": false});
				}

				$('#content a, #secsidebar a').click(function(e){
					if(window.location.pathname == this.pathname && this.hash.indexOf('panel') > -1 && !$(this).hasClass('accordion-toggle')){
						e.preventDefault();

						$('.panel-collapse.collapse.in').prev().children('h3').children('a').attr("aria-expanded","false").addClass('collapsed');
						$('.panel-collapse.collapse.in').removeClass('in').attr("aria-expanded","false")

						$(this.hash).addClass('in').attr("aria-expanded","true").css('height','auto');
						$(this.hash).prev().children('h3').children('a').attr("aria-expanded","true").removeClass('collapsed');

						var offset = $(this.hash).parent().offset();
						$("html, body").animate({scrollTop: offset.top},{"queue": false});
					}
				});
			});
		

